import { React, props } from "react";

const SavedPost = ({ posts } = React.props) => {
    console.log(posts);
    return (
        <div className="card mt-4">
            <p className="card-body">This is the content...</p>
            <div className="card-footer">Footer</div>
        </div>
    );
};

export default SavedPost;
